import React, { useState } from "react";
import { Layout } from "antd";
import Sidebar from "../src/components/Sidebar";

const { Sider, Content } = Layout;
function App() {
  const [collapsed, setCollapsed] = useState(false);

  return (
    <Layout>
      <Sider
        theme="light"
        trigger={null}
        collapsible
        collapsed={collapsed}
        className="sider"
      >
        <Sidebar />
      </Sider>

      <Layout>
        <Content></Content>
      </Layout>
    </Layout>
  );
}

export default App;
